import React from 'react'
import { Row, Col } from 'react-bootstrap'
import { blogposts } from '../data.js'

const Posts = () => {
  return (
    <div>
      <h2>Blog Posts:</h2>
      {blogposts.map((blogpost) => (
        <div className='blogposts' key={blogpost}>
          {blogpost.name}
          {blogpost.content}
          {blogpost.date}
        </div>
      ))}
    </div>
  )
}

export default Posts
